import React from "react";
import styled from "styled-components";
import Burger from "./Burger";

const Navbar = () => {
  const showModal = (e) => {
    document.body.style.overflow = "hidden";
  };
  const hideModal = (e) => {
    document.body.style.overflow = "unset";
  };
  return (
    <Container>
      <Wrap>
        <Gnb>
          <LogoWrap>
            <Logo>ahreum</Logo>
          </LogoWrap>
          <NavWrap>
            <Nav>
              <ul>
                <li>
                  <a href="#about">ABOUT</a>
                </li>
                <li>
                  <a href="#about">SKILLS</a>
                </li>
                <li>
                  <a href="#develop">DEVELOP</a>
                </li>
                <li>
                  <a href="#project">PROJECT</a>
                </li>
              </ul>
            </Nav>
          </NavWrap>
          <RightNavWrap>
            <Burger />
          </RightNavWrap>
        </Gnb>
      </Wrap>
    </Container>
  );
};

const Container = styled.header`
  width: 100%;
  height: 100px;
  line-height: 100px;
  background: ${({ theme }) => theme.colors.main_color};
  /* background: ${({ scroll }) => (scroll > 100 ? "#fff" : "#112D4E")};
  color: ${({ scroll }) => (scroll > 100 ? "#112D4E" : "#050505")}; */
  /* opacity: ${({ scroll }) => (scroll > 100 ? "0.5" : "1")}; */
  font-size: ${({ theme }) => theme.fonts.fontMicro};
  font-weight: ${({ theme }) => theme.fonts.weightBold};
  position: fixed;
  top: 0;
  z-index: 100;
`;

const Wrap = styled.div`
  width: 100%;
  max-width: 1400px;
  margin: 0 auto;
`;
const Gnb = styled.div`
  width: 100%;
  display: flex;
  justify-content: space-between;
  align-items: center;
  position: relative;
`;

const LogoWrap = styled.div`
  width: 10%;
`;
const Logo = styled.h1`
  font-weight: 600;
  font-size: 22px;
  color: ${({ scroll }) => (scroll > 100 ? "#112D4E" : "#fff")};
`;

const NavWrap = styled.div`
  width: 80%;
`;

const Nav = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  justify-content: flex-end;
  align-items: center;

  ul {
    width: 60%;
    display: flex;
    justify-content: space-evenly;
    align-items: center;
    li {
      font-size: 15px;
      font-weight: ${({ theme }) => theme.colors.weightSemiBold};
      a {
        color: ${({ scroll }) => (scroll > 100 ? "#112D4E" : "#fff")};
      }
    }
  }
`;

const RightNavWrap = styled.div`
  width: 10%;
  position: absolute;
  right: 0;
`;

export default Navbar;
